import React from 'react';
import './App.scss';

import CircleBackground from './widgets/CircleBackground/CircleBackground'
import Card from './widgets/Card/Card'

import {ColumnContainer, ColumnContainerExtended} from './widgets/FlexShorthand/FlexShorthand'


class App extends React.Component {


  render() {
    return (
      <ColumnContainerExtended className="App" >
      <CircleBackground/>
      <ColumnContainerExtended className="App-header">

          <Card>
            Fetch orginal requests
          </Card>

          <Card>
            Robot Control Panel
          </Card>

        </ColumnContainerExtended>
      </ColumnContainerExtended>
    )
  }

}

export default App;
